INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "あたしだって\nやるときはやるよ！", "リン", 0.0, 24, 10040, 24001, "2020/04/30 12:00:00", 0, 102601);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "ふぅ…\nこれであたしの仕事は\n終わりだね", "リン", 0.0, 24, 10040, 24002, "2020/04/30 12:00:00", 1, 102601);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "終わった終わった\n一人でもなんとか\nなるもんだね", "リン", 0.0, 24, 10040, 24003, "2020/04/30 12:00:00", 2, 102601);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (2, 0.0, 2, "2030/12/17 14:59:59", 0.0, "やったね！\nこれでようやく\nサボれるよ…", "リン", 0.0, 24, 10040, 24004, "2020/04/30 12:00:00", 3, 102601);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", "リン", 0.0, 24, 10040, 24005, "2020/04/30 12:00:00", 4, 102601);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (2, 0.0, 2, "2030/12/17 14:59:59", 0.0, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", "リン", 0.0, 24, 10040, 24006, "2020/04/30 12:00:00", 5, 102601);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (2, 0.0, 2, "2030/12/17 14:59:59", 0.0, "あたしも意外と\nやるもんでしょ？", "リン", 0.0, 24, 10040, 24007, "2020/04/30 12:00:00", 6, 102601);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (4, 0.0, 4, "2030/12/17 14:59:59", 0.0, "疲れた…\nねずみの逃げ足\n速すぎるよ…", "リン", 0.0, 24, 10040, 24008, "2020/04/30 12:00:00", 7, 102601);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (4, 0.0, 4, "2030/12/17 14:59:59", 0.0, "このままじゃ\nまっひ～に\n叱られちゃうよ", "リン", 0.0, 24, 10040, 24009, "2020/04/30 12:00:00", 8, 102601);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (4, 0.0, 4, "2030/12/17 14:59:59", 0.0, "まじめに\nやったんだけどな…\n悔しいな～", "リン", 0.0, 24, 10040, 24010, "2020/04/30 12:00:00", 9, 102601);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (4, 0.0, 4, "2030/12/17 14:59:59", 0.0, "やられた…\nねずみって意外と\nてごわいね", "リン", 0.0, 24, 10040, 24011, "2020/04/30 12:00:00", 10, 102601);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (4, 0.0, 4, "2030/12/17 14:59:59", 0.0, "おのれ～\nあたしのチーズを\n盗みやがって～！", "リン", 0.0, 24, 10040, 24012, "2020/04/30 12:00:00", 11, 102601);
INSERT INTO `v1_d5980c221dfd36b991df597fb0c3abcb6ced1a3f999e92abfb24d050371a7112` VALUES (4, 0.0, 1, "2030/12/17 14:59:59", 0.0, "疲れた…\nけど、次こそは\n守り抜くよ…", "リン", 1.81, 24, 10040, 24013, "2020/04/30 12:00:00", 12, 102601);
